import React from 'react';
import { Cell } from 'fixed-data-table-2';

class PendingCell extends React.Component {
  render() {
    const { data, rowIndex, columnKey, dataVersion, ...props } = this.props;
    const rowObject = data.getObjectAt(rowIndex);
    return (
      <Cell {...props}>
        {rowObject ? (
          rowObject[columnKey]
        ) : (
          <img
            width="16"
            height="16"
            alt="star"
            src="data:image/gif;base64,"
          />
        )}
      </Cell>
    );
  }
}

const ImageCell = ({ data, rowIndex, columnKey, ...props }) => {
  return <img src={data.getObjectAt(rowIndex)[columnKey]} style={{ height: "120px", width: "120px" }} />;
}

class PendingImageCell extends React.Component {
  render() {
    const { data, rowIndex, columnKey, dataVersion, ...props } = this.props;
    const rowObject = data.getObjectAt(rowIndex);
    return (
      <Cell {...props}>
        {rowObject ? (
          // <ExampleImage src={rowObject['avatar']} />
          <ImageCell {...this.props} />
        ) : (
          <img
            width="16"
            height="16"
            alt="star"
            src="data:image/gif;base64,"
          />
        )}
      </Cell>
    );
  }
}
export const PagedCell = ({ data, ...props }) => {
  const dataVersion = data.getDataVersion();
  return (
    <PendingCell data={data} dataVersion={dataVersion} {...props}></PendingCell>
  );
};

export const PagedImageCell = ({data, ...props}) => {
  const dataVersion = data.getDataVersion();
  return (
    <PendingImageCell data={data} dataVersion={dataVersion} {...props}></PendingImageCell>
  );
}

